import React from 'react';
import { FaUser, FaEnvelope, FaSearch } from 'react-icons/fa'; // Importing Profile, Message, and Search icons
import '/home/rguktongole/Desktop/ideanexus/frontend/src/styles/UserDashboard.css'; // Updated relative path for styling

const Dashboard = () => {
    return (
        <div className="dashboard-container">
            <header className="dashboard-header">
                <div className="profile-logo" title="Profile">
                    {/* Profile Icon */}
                    <FaUser size={24} />
                </div>
                <div className="search-container">
                    {/* Search Icon inside the search bar */}
                    <FaSearch size={20} className="search-icon" />
                    <input
                        type="text"
                        className="search-bar"
                        placeholder="Search..."
                        aria-label="Search"
                    />
                </div>
                <div className="message-icon" title="Messages">
                    {/* Message Icon */}
                    <FaEnvelope size={24} />
                </div>
            </header>

            <main className="dashboard-content">
                {/* Example Content */}
                <h1>Welcome to IdeaNexus!</h1>
                <p>Your posts, profiles, and interactions will be displayed here. Start exploring!</p>
            </main>
        </div>
    );
};

export default Dashboard;
